import React, { Fragment } from "react";
import { Menu } from "antd";
import "./style.css";

export default () => {
  return (
    <Fragment>
      <div className="head">
        <Menu mode="horizontal">
        <Menu.Item key="mail">
          Navigation One
        </Menu.Item>
        <Menu.Item key="mail" icon={<MailOutlined />}>
          Navigation One
        </Menu.Item>
        <Menu.Item key="mail" icon={<MailOutlined />}>
          Navigation One
        </Menu.Item>
        <Menu.Item key="mail" icon={<MailOutlined />}>
          Navigation One
        </Menu.Item>
        </Menu>
      </div>
    </Fragment>
  );
};
